import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "accept";
const pathData = "M468.5 106c6 7 9 16 9 24v3c0 9-4 18-11 25l-244 243c-7 7-15 10-24 10-10 0-20-4-28-12l-125-129c-7-7-10-15-10-24 0-10 4-20 12-28 7-6 16-9 24-10 10 0 20 4 28 12l100 103 217-219c7-7 15-10 24-10 10 0 20 4 28 12z";
const ltr = true;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
